import PatientPanel from "./PatientPanel";

function Patients() {
  const records = [
    {
      treatID: 101,
      treatCourseID: "ABC123",
      type: "Operation",
      category: "Hospital",
      name: "Clark Samuel",
      startDate: "11/12/19",
    },
    {
      treatID: 102,
      treatCourseID: "ZDF045",
      type: "Consultation",
      category: "Consultaion and check-up",
      name: "Joe Pan",
      startDate: "22/05/20",
    },
    {
      treatID: 103,
      treatCourseID: "OGR999",
      type: "Medicine",
      category: "Medicine and different types of tablets",
      name: "Lilly Hardy",
      startDate: "29/06/20",
    },
    {
      treatID: 104,
      treatCourseID: "PJF231",
      type: "Clinical Report",
      category: "Clinical Report and attached documents and history",
      name: "Sarah Appleton",
      startDate: "10/12/20",
    },
    {
      treatID: 105,
      treatCourseID: "KHF167",
      type: "Vaccination",
      category: "Hospital",
      name: "Andy Horowitz",
      startDate: "21/03/21",
    },
  ];

  const recordsString = JSON.stringify(records);

  return <PatientPanel medicalRecords={recordsString} />;
}

export default Patients;
